import React from 'react'
import './fetch.css'

function FetchZips(props) {
    return (
        <div>
            <form>
                <h1 className='fetching'>Please enter a ZipCode</h1>
                <p id='nonValid'></p>
                <input className='fetching' id='zip' name='zipCode' type='text' placeholder='10314' onChange={props.handleZipChange}></input>
            </form>
            <br></br>
                <br></br>
        </div>
    )
}

export default FetchZips;
